import React from "react";
import Modal from "./Modal";

const ModalHolder = (props) => {
    var modal = props.modalName;
    const closeModal=()=>{
        props.onClose();
    }

    return (
        <React.Fragment>
            {modal === "projects" &&
                <Modal onClose={closeModal} c
                >
                    <h2>Projects</h2>
                    <ul></ul>
                   
                </Modal>
            }
            {modal === "skills" &&
                <Modal onClose={closeModal} >
                    b
                </Modal>
            }
            {modal === "experience" &&
                <Modal onClose={closeModal} >
                    c
                </Modal>
            }
            {modal === "achievements" &&
                <Modal onClose={closeModal} >
                    d
                </Modal>
            }
        </React.Fragment>
    )
}

export default ModalHolder;
